script: |
  super -f text -I q3252.spq | sort > q3252.out

inputs:
  - name: q3252.spq
    data: |
      SELECT DISTINCT - col1 AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - 52 * col1 / - - col0 BETWEEN col0 / - 23 AND - col2 * 9;
  - name: tab2

outputs:
  - name: q3252.out
    data: |
      -51
      -67
      -77
